se(config_name=\"default_lund_door_set1_config.yaml\")\n        scene_optimizer: SceneOptimizer = instantiate(cfg.SceneOptimizer)\n\n        loader = FolderLoader(os.path.join(DATA_ROOT, \"set1_1_lund_door\"), image_extension=\"JPG\")\n\n        sfm_result_graph = scene_optimizer.create_computation_graph(\n            len(loader),\n            loader.get_valid_pairs(),\n            loader.create_computation_graph_for_images(),\n            loader.create_computation_graph_for_intrinsics(),\n            use_intrinsics_in_verification=True,\n            gt_pose_graph=loader.create_computation_graph_for_poses(),\n        )\n\n        # create dask client\n        cluster = LocalCluster(n_workers=2, threads_per_worker=4)\n\n        with Client(cluster), performance_report(filename=\"dask-report.html\"):\n            sfm_result = sfm_result_graph.compute()\n\n        assert isinstance(sfm_result, SfmResult)\n        \n        MVSNets.densify(sfm_result.sfm_data, \n                        image_path=os.path.join(DATA_ROOT, \"set1_1_lund_door\"), \n                        image_extension=\"JPG\",\n                        view_number=5,\n                        thres=[1.0, 0.01, 0.8])\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","top_units":"screen"},"id":"1093","type":"BoxAnnotation"},{"attributes":{},"id":"1114","type":"LinearScale"},{"attributes":{"text":"Task Stream"},"id":"1110","type":"Title"},{"attributes":{},"id":"1230","type":"DatetimeTickFormatter"},{"attributes":{"child":{"id":"1002"},"title":"Worker Profile (compute)"},"id":"1212","type":"Panel"},{"attributes":{"start":0},"id":"1182","type":"DataRange1d"},{"attributes":{"source":{"id":"1145"}},"id":"1169","type":"CDSView"},{"attributes":{"text":""},"id":"1222","type":"Title"},{"attribu
